CREATE TABLE Categories(
	Id int NOT NULL,
	Name nchar(50) NOT NULL,
	NameVN nchar(50) NOT NULL,
	CONSTRAINT PK_Categories PRIMARY KEY (Id),
	UNIQUE(Name)
);

CREATE TABLE Customers(
	Id nchar(20) NOT NULL,
	Password nchar(50) NOT NULL,
	Fullname nchar(50) NOT NULL,
	Email nchar(50) NOT NULL,
	Photo nchar(50) NOT NULL,
	Activated BIT NOT NULL,
	Admin BIT NOT NULL,
	CONSTRAINT PK_Customers PRIMARY KEY(Id)
);

CREATE TABLE HitCounters(
	Url nchar(100) NOT NULL,
	Count int NOT NULL,
	CONSTRAINT PK_HitCounters PRIMARY KEY(Url)
);

CREATE TABLE OrderDetails(
	Id int NOT NULL,
	OrderId int NOT NULL,
	ProductId int NOT NULL,
	UnitPrice FLOAT NOT NULL,
	Quantity int NOT NULL,
	Discount FLOAT NOT NULL,
	CONSTRAINT PK_OrderDetails PRIMARY KEY(Id),
	UNIQUE (Id)
);

CREATE TABLE Orders(
	Id int NOT NULL,
	CustomerId nchar(20) NOT NULL,
	OrderDate DATE NOT NULL,
	Address nchar(250) NOT NULL,
	Amount FLOAT NOT NULL,
	Description nchar(1000) NULL,
	CONSTRAINT PK_Orders PRIMARY KEY(Id)
);

CREATE TABLE Products(
	Id INT NOT NULL,
	Name nchar(50) NOT NULL,
	UnitPrice FLOAT NOT NULL,
	Image nchar(50) NULL,
	ProductDate DATE NOT NULL DEFAULT NOW(),
	Available BIT NOT NULL,
	CategoryId int NOT NULL,
	Quantity INT NOT NULL DEFAULT 0,
	Description nchar(250) NULL,
	Discount float NOT NULL,
	ViewCount int NOT NULL,
	Special BIT NOT NULL,
	CONSTRAINT PK_Products PRIMARY KEY (Id),
	UNIQUE(Name),
	CHECK(UnitPrice >= 0),
	CONSTRAINT FK_Products FOREIGN KEY (CategoryId) REFERENCES Categories(Id)
		ON DELETE NO ACTION ON UPDATE CASCADE 
);







